    "description":"Buukkaukset: mdstudio@hel.fiKia RyhänenTiedusteluviestiin toivomme:1.Lyhyt esittely projektista.2. Millaisina aikoina voitte tulla studioon?3. Bändin jäsenten iät ja paikkakunta.4. Yhteyshenkilön nimi ja puhelinnumero.Soittopyynnönkin voi jättää sähköpostitse niin palaamme asiaan muutaman päivän sisällä.INFO:MD-Studio on hyvin varusteltu äänitysstudio jossa puitteet riittävät ammattitasoiseen saundiin. Studio soveltuu erityisen hyvin pop-, rock- ja metallibändeille mutta on vuosin varrella joustanut niin hiphopin kuin klassisen musiikin suuntaan ja kaikkea siitä välistä. Voit olla ensikertalainen tai kokenut. Äänittäjämme ovat aina valmiita toteuttamaan sinun visiosi, ja auttamaan löytämään sitä, mikäli se ei ole vielä täysin selvä. Osaava henkilökunta ja edullinen hinta ovat varmistaneet studion suosion jo yli 20 vuotta. Sessio kestää 1-3 päivää. Päivä on 8h pitkä.Studiomaksu maksetaan aina tasarahana ja käteisenä ensimmäisen studiopäivän alussa. Hinta sisältää studioajan, äänittäjän sekä masterin CD-r-levyllä, jonka bändi saa mukaansa.Studiovarustuksiin kuuluu muutama kitaravahvistin. Bogner Uberschall ja Line 6.Bändillä tulee olla omat soittokamat (kitara, basso, rummut, synat etc.)Studion käyttömaksu:Alle 25-vuotiaat helsinkiläiset muusikot ja bändit, 55 € päivä.Ulkopaikkakuntalaiset sekä 25–29-vuotiaat, 75 € päivä.3-päivän sessiot 155 € Helsinkiläisille ja 215 € ulkopaikkakuntalaisille.",
