    "description":"Oletko kiinnostunut pelaamaan amerikkalaista jalkapalloa korkeakoulusarjassa?\n\nAmerikkalainen jalkapallo on urheilulaji, josta löytyy monen erityyppistä urheilijaa. Korkeakoulusarjassa löytyy pelaajia kaikilta kokemustasoilta: aloittelijoista Vaahteraliiga- ja maajoukkuepelaajiin. Monet pelaajat ovat löytäneet lajin Aalto Predatorsin kautta, joten olipa kokemustasosi mikä tahansa niin olet tervetullut liittymään yhdistykseen ja osallistumaan meidän treeneihin.\n\nMeidän miesten joukkueessamme, Aalto Predators, voivat kaikki Aalto-yliopiston miespuoliset opiskelijat pelata. Naisten joukkueemme, Aalto Aliens, on avoin kaikille pääkaupunkiseudun korkeakoulujen ja ammattikorkeakoulujen naisopiskelijoille.\n\nYhdistyksemme on myös mahdollista liittyä valmentajana tai toimitsijana, auttaen yhdistyksen toiminnan ja tapahtumien mahdollistamisessa.\n\nOta meidän amerikkalaisiin jalkapallo joukkueisiin yhteyttä lähettämällä viesti heidän Facebook sivuille:\nfb.com/aaltojefu\nTai lähetä meidän yhdistykselle sähköpostia osoitteeseen: hallitus@predators.fi\n\nAalto Predators on Aalto-yliopiston amerikkalaisen jalkapallon joukkue. Joukkue pelaa Suomen korkeakoulusarjassa, jossa on pelaajia kaikilta kokemustasoilta: aloittelijoista Vaahteraliiga- ja maajoukkuepelaajiin. Korkeakoulusarja pelataan helmikuusta toukokuuhun ja treenit alkavat syyskuussa. Aalto Predators voitti ensimmäistä kertaa Opiskelijoiden Suomen Mestaruuskisat vuonna 2016.\n\nAmerikkalainen jalkapallo on urheilulaji, josta löytyy monen erityyppistä urheilijaa, pienemmät ja vikkelät taitopelaajat ovat yhtä tärkeitä kuin isommat linjamiehet. Monet pelaajat ovat löytäneet lajin Aalto Predatorsin kautta, joten olipa kokemustasosi mikä tahansa niin olet tervetullut liittymään yhdistykseen ja osallistumaan meidän treeneihin.\n\nAalto Predators perustettiin vuonna 2012. Yhdistys osallistuu erilaisiin opiskelijatapahtumiin Otaniemessä ja Töölössä, kuten esimerkiksi KY City Challenge, Otawappu, Helle- ja TalviAalto. Joukkue järjestää myös yhteisiä kisakatsomo- ja ajanviettoiltoja. Aalto Predators järjestävää myös vuosittain Super Bowl -juhlat, sekä muita kisakatsomoiltoja, joihin kaikki Aalto-yliopiston opiskelijat ovat tervetulleita. Kerhossa on pelaajien lisäksi myös entisiä pelaajia ja amerikkalaisen jalkapallon faneja, jotka tukevat joukkuetta järjestämällä tapahtumia tai olemalla sen hallituksessa tai toimitsijoina.\n\nTryoutit järjestetään syksyllä, lukuvuoden alussa! Jos et pääse tryoutteihin, voit kuitenkin tulla kokeilemaan lajia harjoituksiimme lähettämällä viestin meidän Facebook -sivulle tai sähköpostia hallituksellemme: hallitus@predators.fi. Valmentajamme pitävät treenit sekä suomeksi että englanniksi.\n\nLisää tietoa löytyy meidän Facebook-, facebook.com/aaltojefu, ja nettisivuilta predators.fi.\n\nYhdistyksellämme on myös Cheerleading -joukkue, Aalto Predators Cheerleaders – Foxes, joka tarjoaa toisen loistavan urheiluharrastuksen opiskelijoille. Heidän Facebook -sivut löytyvät osoitteesta facebook.com/APCfoxes.",
