    "description":"Lauantai-Tennis on yksi Aalto Tenniksen tarjoamista, mahtavista jäseneduista! Lauantai-Tenniksen kautta pääset pelaamaan edullisesti Esport Centerissä Tapiolassa.\n\nLauantaitennis mahdollistaa pelaamisen, vaikkei pelikaveria olisi. Tapahtuman alkaessa jaamme pelaajat eri kentille heidän pelitasonsa mukaan. Pelaaminen on vapaamuotoista ja osallistujamäärästä sekä tasosta riippuen tiukkaa taistoa, kevyttä pallottelua tai kaikkea siltä väliltä.\n\nAalto Tennis, entiseltä nimeltään Teekaritennis, on vuonna 1965 perustettu Aalto-yliopiston alainen opiskelijayhdistys. Aalto Tennis on myös Suomen tennisliiton hyväksymä, virallinen tennisseura. Yhdistyksen ovat perustaneet teekarit, joiden yhteisenä intohimona on tennis. Nykyisin jäseniksi ovat tervetuleita kaikkien korkeakoulujen opiskelijat tieteenalasta riippumatta.\n\nTavoitteenamme on tarjota laadukasta ja opiskelijan lompakolle sopivaa valmennusta. Lisäksi ärjestämme erilaisia tapahtumia, kuten turnauksia, ekskursioita, pelipäiviä ja illanviettoja.\n\nJäsenistömme koostuu kaikentasoisista pelaajista aina aloittelijoista A-luokan kilpapelaajiin, joten jokainen löytää tasostaan riippumatta itselleen peliseuraa.\n\nLiity Aalto Tenniikseen – et kadu sitä!",
